import React, { useState, useEffect } from 'react';
import { getEvents } from '../../fetch';
// import axios from 'axios';
import { API_KEY, CALENDAR_ID } from '../../base';

import BookingCalendar from 'react-booking-calendar';
import { CalendarWrapper, Container } from './hausboot-rot.styles';

const HausbootRot = () => {
	let GOOGLE_CALENDAR_URL = `https://www.googleapis.com/calendar/v3/calendars/${CALENDAR_ID}/events?key=${API_KEY}`;
	const [data, setData] = useState({ hits: [] });

	const getDaysArray = function (start, end) {
		for (var arr = [], dt = new Date(start); dt <= end; dt.setDate(dt.getDate() + 1)) {
			arr.push(new Date(dt));
		}
		return arr;
	};
	const dayslist = getDaysArray(new Date('2021-05-01'), new Date('2021-05-06'));

	useEffect(() => {
		const fetchData = async () => {
			const result = await axios(GOOGLE_CALENDAR_URL);

			setData(result.data);
		};

		fetchData();
	}, [GOOGLE_CALENDAR_URL]);
	const bookings = [new Date('2021-04-26')];
	return (
		<div>
			<Container>
				<CalendarWrapper>
					<BookingCalendar bookings={bookings} disableHistory />
					<div>
						Test:
						{console.log(data.hits)}
					</div>
				</CalendarWrapper>
			</Container>
		</div>
	);
};

export default HausbootRot;
